export const initialState={
  post:{},
};

const reducer = (state,action)=>{
  switch (action.type) {
    case "FETCH_SUC":
      return {...state,firstCount:state.firstCount + 1,secondCount:state.secondCount+10}
    case "ERROR":
      return {...state,firstCount:state.firstCount - 1}

  }
}

export default reducer
